    [],nt"revision_timestamp": "2016-07-27T22:40:15.842694",nt"name": "procedures-for-sampling-vegetation",nt"isopen":
    false,nt"url": null,nt"notes": "This report outlines vegetation sampling
    procedures used on various refuges in Region 3. The importance of sampling the response
    of marsh vegetation to management is well recognized. Transects are commonly used.
    They are permanently established so that they may be used in future years to provide
    comparable data for evaluating changes. The line-intercept method, the belt transect
    method, the sample plot method, and the time-lag transect method are discussed in
    this report. A description of how and when each method should be used is provided.",nt"license_title":
